import React, { useEffect, useState } from "react";
import "../styles/Home.css";

const Home = () => {
  const [imoveisVenda, setImoveisVenda] = useState([]);
  const [imoveisAluguel, setImoveisAluguel] = useState([]);

  useEffect(() => {
    const fetchImoveis = async () => {
      try {
        const vendaResponse = await fetch("http://localhost:5000/imoveisVenda");
        const vendaData = await vendaResponse.json();
        setImoveisVenda(vendaData);

        const aluguelResponse = await fetch("http://localhost:5000/imoveisAluguel");
        const aluguelData = await aluguelResponse.json();
        setImoveisAluguel(aluguelData);
      } catch (error) {
        console.error("Erro ao buscar imóveis:", error);
      }
    };

    fetchImoveis();
  }, []);

  return (
    <div className="home">
      <h1>Imóveis à Venda</h1>
      <div className="properties">
        {imoveisVenda.map((imovel) => (
          <div key={imovel.id} className="property-card">
            <p><strong>Tipo:</strong> {imovel.tipo}</p>
            <p><strong>Área:</strong> {imovel.area}</p>
            <p><strong>Cômodos:</strong> {imovel.comodos}</p>
            <p><strong>Endereço:</strong> {imovel.endereco.cidade} - {imovel.endereco.estado}</p>
          </div>
        ))}
      </div>

      <h1>Imóveis para Aluguel</h1>
      <div className="properties">
        {imoveisAluguel.map((imovel) => (
          <div key={imovel.id} className="property-card">
            <p><strong>Tipo:</strong> {imovel.tipo}</p>
            <p><strong>Área:</strong> {imovel.area}</p>
            <p><strong>Cômodos:</strong> {imovel.comodos}</p>
            <p><strong>Endereço:</strong> {imovel.endereco.cidade} - {imovel.endereco.estado}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Home;
